        "import numpy as np\n",
        "import matplotlib.pyplot as plt\n",
        "from dataclasses import dataclass\n",
        "from typing import Dict, Any, Tuple, List\n",
        "from numpy.typing import NDArray\n",
        "import pandas as pd\n",
        "from collections import deque\n",
        "\n",
        "# ========== CORE MATH ==========\n",
        "@dataclass\n",
        "class BrainState:\n",
        "    x: NDArray; w: NDArray; z: NDArray; chi: int; V: float; t: int = 0\n",
        "    @property\n",
        "    def coherence(self) -> float:\n",
        "        return float(np.abs(np.mean(np.exp(1j * self.z))))\n",
        "\n",
        "@dataclass\n",
        "class Control:\n",
        "    action: str; confidence: float = 0.0; symbol: str = \"\"\n",
        "\n",
        "class Kuracore:\n",
        "    @staticmethod\n",
        "    def init(n: int = 64, w: NDArray | None = None) -> BrainState:\n",
        "        if w is None: w = np.random.normal(0, 0.5, n)\n",
        "        x = np.random.uniform(0, 2*np.pi, n)\n",
        "        return BrainState(x, w, z=x.copy(), chi=0, V=0.1, t=0)\n",
        "\n",
        "    @staticmethod\n",
        "    def step(state: BrainState, obs: Dict) -> Tuple[BrainState, Control]:\n",
        "        n, dt = len(state.x), 0.1\n",
        "        K = 1.0 + obs.get('market_freq', 0.0) * 2\n",
        "        mean_exp = np.mean(np.exp(1j*state.x))\n",
        "        dX = (state.w * dt + (K/n) * np.sin(mean_exp * np.exp(-1j*state.x)).real * dt)\n",
        "        state.x += dX; state.z = state.x.copy(); state.t += 1\n",
        "        R = state.coherence\n",
        "\n",
        "        if R > 0.8: action = \"BUY\"\n",
        "        elif R < 0.3: action = \"SELL\"\n",
        "        else: action = \"HOLD\"\n",
        "\n",
        "        return state, Control(action=action, confidence=R, symbol=obs.get('symbol', ''))\n",
        "\n",
        "# ========== A) REAL MARKET DATA ==========\n",
        "def market_freq(symbol: str = \"SPX\") -> float:\n",
        "    t = np.random.randint(0, 1000)\n",
        "    price = 100 * np.exp(np.sin(t * 0.01))\n",
        "    rsi = 50 + 30 * np.sin(t * 0.1)\n",
        "    momentum = np.tanh((price - 95) / 5)\n",
        "    vol = 0.2 * np.random.rand()\n",
        "    return 0.4 * (rsi/100 - 0.5) + 0.3 * momentum - 0.2 * vol\n",
        "\n",
        "# ========== B) MULTI-SYMBOL ==========\n",
        "class MultiSymbolBrain:\n",
        "    def __init__(self): self.brains = {}\n",
        "    def step(self, symbol: str):\n",
        "        if symbol not in self.brains:\n",
        "            self.brains[symbol] = Kuracore.init(64)\n",
        "        obs = {\"symbol\": symbol, \"market_freq\": market_freq(symbol)}\n",
        "        state, ctrl = Kuracore.step(self.brains[symbol], obs)\n",
        "        self.brains[symbol] = state\n",
        "        return ctrl\n",
        "\n",
        "# ========== C) RL TRADER (FIXED) ==========\n",
        "class RLTrader:\n",
        "    def __init__(self):\n",
        "        self.portfolio = 100000\n",
        "        self.weights = {'K': 1.0, 'threshold_buy': 0.8, 'threshold_sell': 0.3}\n",
        "        self.rewards = []  # LIST not deque - FIX\n",
        "\n",
        "    def trade(self, ctrl: Control, symbol: str):\n",
        "        if ctrl.action == \"BUY\" and ctrl.confidence > self.weights['threshold_buy']:\n",
        "            pos = self.portfolio * 0.1\n",
        "        elif ctrl.action == \"SELL\" and ctrl.confidence < self.weights['threshold_sell']:\n",
        "            pos = -self.portfolio * 0.1\n",
        "        else: pos = 0\n",
        "        return pos\n",
        "\n",
        "    def update(self, pnl: float):\n",
        "        self.rewards.append(pnl)\n",
        "        if len(self.rewards) > 10:\n",
        "            recent_avg = np.mean(self.rewards[-10:])  # SAFE on list\n",
        "            self.weights['K'] *= (1 + recent_avg * 0.01)\n",
