        "import torch\n",
        "import torch.nn as nn\n",
        "import numpy as np\n",
        "from typing import List, Dict, Any\n",
        "import json\n",
        "\n",
        "# FIXED KuraLSTM (num_layers=2 for dropout)\n",
        "class KuraLSTM(nn.Module):\n",
        "    def __init__(self, n_features=5, n_hidden=128, dropout=0.2, K=1.5, sigma=0.01):\n",
        "        super().__init__()\n",
        "        self.lstm = nn.LSTM(n_features, n_hidden, num_layers=2, batch_first=True, dropout=dropout)\n",
        "        self.fc = nn.Linear(n_hidden, 1)\n",
        "        self.K = K\n",
        "        self.sigma = sigma\n",
        "\n",
        "    def forward(self, x):\n",
        "        lstm_out, _ = self.lstm(x)\n",
        "        phase = torch.sin(lstm_out.mean(dim=1)) * self.K\n",
        "        return self.fc(lstm_out[:, -1, :]) + phase[:, :1]\n",
        "\n",
        "# Load model (demo mode OK)\n",
        "BEST_PARAMS = {'n_hidden': 128, 'dropout': 0.2, 'K': 1.5, 'sigma': 0.01}\n",
        "model = KuraLSTM(n_features=5, **BEST_PARAMS)\n",
        "try:\n",
        "    model.load_state_dict(torch.load('kuracore_optimized.pt', map_location='cpu'))\n",
        "    print(\"âœ… Loaded optimized model\")\n",
        "except:\n",
        "    print(\"âš ï¸ Demo mode - random weights\")\n",
        "model.eval()\n",
        "\n",
        "# FIXED PURE PYTHON predict function (no FastAPI)\n",
        "def predict_market(ohlcv: List[List[float]], symbol: str = \"SPY\") -> Dict[str, Any]:\n",
        "    \"\"\"Core Kuracore prediction function\"\"\"\n",
        "    if len(ohlcv) != 10 or any(len(t) != 5 for t in ohlcv):\n",
        "        raise ValueError(\"Need exactly 10 timesteps of [O,H,L,C,V]\")\n",
        "\n",
        "    # Normalize\n",
        "    ohlcv_arr = np.array(ohlcv, dtype=np.float32)\n",
        "    ohlcv_norm = (ohlcv_arr - ohlcv_arr.mean()) / (ohlcv_arr.std() + 1e-8)\n",
        "    X = torch.FloatTensor(ohlcv_norm[None])  # [1,10,5]\n",
        "\n",
        "    # Inference\n",
        "    with torch.no_grad():\n",
        "        signal = model(X).item()\n",
        "\n",
        "    confidence = 1.0 / (1.0 + np.exp(-np.abs(signal)))\n",
        "\n",
        "    return {\n",
        "        \"symbol\": symbol,\n",
        "        \"signal\": round(float(signal), 4),\n",
        "        \"confidence\": round(confidence, 3),\n",
        "        \"action\": \"ðŸŸ¢ BUY\" if signal > 0.02 else \"ðŸ”´ SELL\" if signal < -0.02 else \"ðŸŸ¡ HOLD\",\n",
        "        \"phase_sync\": round(float(model.K * model.sigma), 3),\n",
        "        \"kuramoto_K\": float(model.K)\n",
        "    }\n",
        "\n",
        "# TEST IT\n",
        "print(\"ðŸš€ Kuracore AI Live!\")\n",
        "demo_data = [[100+i*0.1, 101+i*0.15, 99+i*0.05, 100.5+i*0.12, 1000000] for i in range(10)]\n",
        "result = predict_market(demo_data, \"SPY\")\n",
        "print(\"DEMO RESULT:\", json.dumps(result, indent=2))\n",
        "\n",
        "print(\"\\nðŸŽ‰ READY!\")\n",
        "print(\"Use: result = predict_market(your_ohlcv_data, 'AAPL')\")\n"
