        "def get_real_price(symbol=\"SPY\"):\n",
        "    \"\"\"Real prices w/ fallback\"\"\"\n",
        "    try:\n",
        "        ticker = yf.Ticker(symbol)\n",
        "        data = ticker.history(period=\"2d\", interval=\"15m\")\n",
        "        ohlcv = data[['Open', 'High', 'Low', 'Close', 'Volume']].tail(10).values.tolist()\n",
        "        return ohlcv, data['Close'].iloc[-1]\n",
        "    except:\n",
        "        t = np.linspace(0, 10, 100)\n",
        "        price = 500 + 10*np.sin(t) + np.cumsum(np.random.randn(100)*2)\n",
        "        ohlcv = [[price[i], price[i]+1, price[i]-1, price[i+1], 10000000] for i in range(90, 99)]\n",
        "        return ohlcv, price[-1]\n",
        "\n",
        "def execute_buy(signal, size_usd):\n",
        "    \"\"\"Paper trading BUY\"\"\"\n",
        "    symbol = signal['symbol']\n",
        "    price = signal.get('current_price', 500)\n",
        "    shares = int(size_usd / price)\n",
        "    cost = shares * price\n",
        "\n",
        "    if cash >= cost:\n",
        "        positions[symbol] = positions.get(symbol, 0) + shares\n",
        "        globals()['cash'] -= cost  # Update global cash\n",
        "        return {\n",
        "            \"action\": \"BUY\", \"symbol\": symbol, \"shares\": shares,\n",
        "            \"price\": price, \"cost\": cost, \"cash_left\": cash\n",
        "        }\n",
        "    return {\"error\": \"Insufficient cash\"}\n",
        "\n",
        "def execute_sell(signal, size_usd):\n",
        "    \"\"\"Paper trading SELL\"\"\"\n",
        "    symbol = signal['symbol']\n",
        "    price = signal.get('current_price', 500)\n",
        "    shares = min(int(size_usd / price), positions.get(symbol, 0))\n",
        "    proceeds = shares * price\n",
        "\n",
        "    if shares > 0:\n",
        "        positions[symbol] -= shares\n",
        "        globals()['cash'] += proceeds\n",
        "        return {\n",
        "            \"action\": \"SELL\", \"symbol\": symbol, \"shares\": shares,\n",
        "            \"price\": price, \"proceeds\": proceeds, \"cash_left\": cash\n",
        "        }\n",
        "    return {\"error\": \"No position\"}\n",
        "\n",
        "print(\"âœ… STEP 2: Broker simulator live\")\n"
