        "import numpy as np\n",
        "import matplotlib.pyplot as plt\n",
        "from scipy.integrate import odeint\n",
        "\n",
        "def kuramoto_order_parameter(phases, K=1.5):\n",
        "    \"\"\"Core Kuramoto synchronization metric R = |1/N Î£ e^(iÏ†j)|\"\"\"\n",
        "    N = len(phases)\n",
        "    complex_sum = np.mean(np.exp(1j * phases))\n",
        "    R = np.abs(complex_sum)  # Order parameter [0,1]\n",
        "    return R, np.angle(complex_sum)\n",
        "\n",
        "def kuramoto_dynamics(phi, t, K, N):\n",
        "    \"\"\"Kuramoto model differential equations dÏ†j/dt = Ï‰j + (K/N) Î£ sin(Ï†j - Ï†k)\"\"\"\n",
        "    omega = np.random.uniform(-1, 1, N)  # Natural frequencies\n",
        "    dphi_dt = omega + (K / N) * np.sum(np.sin(phi[:, None] - phi[None, :]), axis=1)\n",
        "    return dphi_dt\n",
        "\n",
        "# Simulate market phase synchronization\n",
        "N = 50  # Number of oscillators (market participants)\n",
        "phi0 = np.random.uniform(0, 2*np.pi, N)\n",
        "t = np.linspace(0, 50, 1000)\n",
        "sol = odeint(kuramoto_dynamics, phi0, t, args=(1.5, N))\n",
        "\n",
        "R_t = [kuramoto_order_parameter(phi)[0] for phi in sol]\n",
        "plt.plot(t, R_t)\n",
