        "import numpy as np\n",
        "import pandas as pd\n",
        "\n",
        "def mutual_information(X, Y, bins=15):\n",
        "    \"\"\"MI - Bulletproof length matching\"\"\"\n",
        "    X = np.asarray(X).flatten()\n",
        "    Y = np.asarray(Y).flatten()\n",
        "    n = min(len(X), len(Y))\n",
        "    X, Y = X[:n], Y[:n]\n",
        "\n",
        "    if n < 10:\n",
        "        return 0.0\n",
        "\n",
        "    hist_xy, _, _ = np.histogram2d(X, Y, bins=bins)\n",
        "    p_xy = hist_xy / (hist_xy.sum() + 1e-12)\n",
        "\n",
        "    hist_x, _ = np.histogram(X, bins=bins)\n",
        "    hist_y, _ = np.histogram(Y, bins=bins)\n",
        "\n",
        "    p_x = hist_x / (hist_x.sum() + 1e-12)\n",
        "    p_y = hist_y / (hist_y.sum() + 1e-12)\n",
        "\n",
        "    px_py = np.outer(p_x, p_y)\n",
        "    mask = (hist_xy > 0)\n",
        "\n",
        "    p_xy_safe = p_xy[mask]\n",
        "    px_py_safe = px_py[mask]\n",
        "\n",
        "    ratio = np.divide(p_xy_safe, px_py_safe, out=np.ones_like(p_xy_safe), where=px_py_safe>0)\n",
        "    return max(np.sum(p_xy_safe * np.log(ratio + 1e-12)), 0.0)\n",
        "\n",
        "def safe_correlation(X, Y):\n",
        "    \"\"\"Safe correlation - exact length matching\"\"\"\n",
        "    X = np.asarray(X).flatten()\n",
        "    Y = np.asarray(Y).flatten()\n",
        "    n = min(len(X), len(Y))\n",
        "    X, Y = X[:n], Y[:n]\n",
        "\n",
        "    if n < 2:\n",
        "        return 0.0\n",
        "\n",
        "    return np.corrcoef(X, Y)[0,1]\n",
        "\n",
        "def rank_signals_by_edge(signals_dict, future_returns):\n",
        "    results = []\n",
        "    for name, signal in signals_dict.items():\n",
        "        edge = mutual_information(signal, future_returns)\n",
        "        corr = safe_correlation(signal, future_returns)\n",
        "\n",
        "        results.append({\n",
        "            'Signal': name,\n",
        "            'MI_Edge_bits': edge,\n",
        "            'Correlation': corr,\n",
        "            'MI_Rank': 0,\n",
        "            'Alpha_Quality': 'A' if edge > 0.02 else 'B' if edge > 0.01 else 'C'\n",
        "        })\n",
        "\n",
        "    df = pd.DataFrame(results).sort_values('MI_Edge_bits', ascending=False)\n",
        "    df['MI_Rank'] = range(1, len(df)+1)\n",
        "    return df\n",
        "\n",
        "def optimize_signal_portfolio(signal_ranking, signals_dict, future_returns, top_n=3):\n",
        "    alpha_signals = signal_ranking.head(top_n)['Signal'].tolist()\n",
        "\n",
