        "    print(\"=\"*40)\n",
        "    for signal in alpha_signals:\n",
        "        edge = signal_ranking[signal_ranking['Signal']==signal]['MI_Edge_bits'].iloc[0]\n",
        "        print(f\"âœ… {signal:<15} | Edge: {edge:.4f} bits\")\n",
        "\n",
        "    # MI-weighted ensemble\n",
        "    ensemble_signal = np.zeros_like(next(iter(signals_dict.values())))\n",
        "    total_weight = 0\n",
        "    for signal_name in alpha_signals:\n",
        "        edge = signal_ranking[signal_ranking['Signal']==signal_name]['MI_Edge_bits'].iloc[0]\n",
        "        ensemble_signal += signals_dict[signal_name] * edge\n",
