        "        R = np.abs(np.mean(np.exp(1j * self.theta)))\n",
        "        brain = self.brain_map[domain_idx]\n",
        "        return {'brain': brain, 'coherence': float(R), 'response': f\"{brain.upper()}: Active (R={R:.3f})\"}\n",
        "\n",
        "@app.post(\"/v1/meta/process\")\n",
        "def meta_process(request: MetaRequest):\n",
        "    meta = MetaKuracore()\n",
        "    return meta.step(request.query)\n"
